SELECT generico_5.anunciante AS datos_copia,   generico_5.medio AS medio,   SUM(generico_5.inversionus) AS sumcalculation_0061002123102817ok FROM generico_5 WHERE ((generico_5.anunciante IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) >= 2010) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) <= 2015) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) IN (2014, 2015))) GROUP BY generico_5.anunciante,   generico_5.medio;
